メーカー名: Kinsmart<br />This is a diecast model Chevrolet Advance Design truck, shown here as a Stepside variant. The Advance Design trucks of 1949 to 1955 have become some of the most iconic ever to be produced. Kinsmart has produced this high quality 1/32 Chevrolet Stepside Pickup Truck in black.
Its key features include:
-ホイール駆動
-ドア開閉可
-プルバックアクション
